["from typing import List, Union

def funcImp(arg1: List[int]) -> Union[List[int], str]:
    count = {}
    duplicate_nums = []
    for num in arg1:
        if num in count:
            count[num] += 1
        else:
            count[num] = 1
    for key, value in count.items():
        if value > 1:
            duplicate_nums.append(key)
    if duplicate_nums:
        return duplicate_nums
    else:
        return 'No duplicate numbers present in the list'"]

