['from typing import List, Optional

def funcImp(nums: List[int]) -> Optional[int]:
    slow = fast = finder = nums[0]
    while True:
        slow = nums[slow]
        fast = nums[nums[fast]]
        if slow == fast:
            break
    while finder != slow:
        finder = nums[finder]
        slow = nums[slow]
    if finder in nums[nums[slow:]]:
        return finder
    return None']

